"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/WQ2Dy4suboHhqzxysOwIDg/l.jpg",
"rating":"5.0",
"reviewcomment":"Tokyo DisneySea is the best theme park in the world.  Nothing else comes even remotely close for me.  I live in Florida and go to Disney parks all the time.  People look at me like I&#39;m crazy (whether I am or not is a discussion for another time) when I tell them that I spent one of my days in Japan at Disney.  I have no regrets because I thought that this place was incredible.  Any park can throw up some roller coasters and thrill rides.  Those are fun, but the experiences I really crave are when a park goes into meticulous detail to construct an area to make you feel like you&#39;re in a far off land.  (Ok, so I already was in a far off land because I was in Japan but work with me here people.)  The kind of place that has huge, impressive creations but also where you can find little details that most people might not even notice or appreciate.  That&#39;s what Tokyo DisneySea was for me, by far more than any other theme park I&#39;ve been to.  From a recreation of Venice to an unbelievable volcano area inspired by Jules Verne there are so many amazing things to discover here.<br><br>Tokyo DisneySea is a completely separate park from Tokyo Disneyland.  There were almost no instances where I said, &#34;Oh, I&#39;ve seen this before.&#34;  The one exception was the Indiana Jones ride, which was like the one at Disneyland in California.  They do have a Tower of Terror, which I did not ride.   I&#39;ve read that the intro and theming is completely different here because The Twilight Zone is apparently not well known in Japan.<br><br>The most breathtaking area for me was &#34;Mysterious Island&#34;.  Imagine a lake in a crater next to a volcano with green copper walkways and structures built throughout.  In the lake is one of the nautilus submarines from Twenty Thousand Leagues Under the Sea.  As someone who used to love the 20K ride at Walt Disney World (and someone who is still bitter that it is gone) being in this area made me so happy.  There is a wonderful 20K ride here that feels like a &#34;next generation&#34; successor of the one that was in Florida.  Of course there was a giant squid attack!  Without giving anything away I&#39;ll just say that this ride solves the problems that made the Florida ride so hard to maintain.  I don&#39;t understand why we don&#39;t have a ride like this at the Florida parks yet.<br><br>There&#39;s also a ride called Journey to the Center of Earth here.  I loved that movie and this ride does not disappoint.  After a long queue in a cave we were ushered into an elevator that took us to the center of the Earth (spoiler alert: it did not really take us to the center of the Earth).  The ride vehicle was fast moving.  I have no idea what was really happening because the ride audio was in Japanese, but we were attacked by a giant lava monster and then rocketed to the exterior of the volcano, which sometimes actually erupts with fire.  Wow!  That&#39;s just one of the sections of the park.  I could go on for hours about the other sections.<br><br>Getting around the park as someone who doesn&#39;t read or speak Japanese was a piece of cake.  Everything from attraction signs to food carts had English prominently displayed on them.  There were a few times where I actually forgot I was in Japan. The cast members will go out of their way to help you if you need assistance with anything. <br><br>Going to this park was definitely a &#34;bucket list&#34; item for me.  It was everything that I had hoped that it would be and more.  I don&#39;t know when, but someday I will go back.",
