"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Vfd4_Sz90j9HVVrtj-BYlg/l.jpg",
"rating":"4.5",
"reviewcomment":"First review for Japan - had to be Ichiran Ramen. In my opinion, one of the tastiest places to get ramen. It is a chain too! <br><br>Located a quick walk away from Shibuya Scramble in Tokyo, there is almost always a line out the door to experience the customizable deliciousness that is Ichiran. After heading down the stairs, you are met with the ticket vending machines common throughout Japan - make sure to put in the moneys first before selecting what you want. Luckily, because it is Tokyo, there is a lot of English readily available. They even have recommendations for first timers.<br><br>After purchasing the ticket, next comes the customizing - you can choose thickness of noodles, how oily the ramen is, what not to include (good for me b/c I don&#39;t like tamanegi/green onions), as well as how spicy you want it. Now, you may think &#34;It&#39;s Japan...how spicy can it be&#34; right? But don&#39;t be fooled. The spicy sauce they include makes the broth red and can be surprising if you are too used to the levels of spiciness already in Japan.<br><br>The experience itself I find to be most intriguing. You sit in a booth with boards to either side of you (so as not to be able to see other patrons), the ramen is served to you through a slit window so you do not see the servers, and everything you need can be found closeby to you, including water, tissues/napkins (usually on the wall behind you), and spoons/ohashi. This is to make sure that one does not get distracted and can solely focus on the ramen at hand. And, before you know it, the ramen at hand is in stomach and you&#39;re out the door w/ a warm, full belly!<br><br>Don&#39;t forget to save broth for extra noodles you can order at the end too ;)",
