"reviewcomment":"When this place first opened I was beyond ecstatic - Ty harbor chain, outdoor terrace AND breakfast. <br><br>The location/venue is superb. Both for its location in daikanyama and because it&#39;s a huge restaurant with terrace seating, rustic indoor seating, casual bar/stool seating and romantic posh seating. A different part of the restaurant depending on your mood. <br><br>However, I find the food to be less than super. Breakfast is only served early in the morning (can&#39;t make it your weekend brunch location) and the food is only &#34;alright.&#34;<br><br>Compared to the other Ty harbor restaurants, I think this one slides on taste because of the location. <br><br>That being said, I see many people enjoying everything from their fluffy pancakes to flatbread pizzas. The fact that you can bring your pet is a nice perk!",
