"reviewcomment":"Who wants to move to Tokyo and open a microbrew / outdoor beer garden / restaurant? Ty Harbor is certainly cornering the market. <br><br>After two weeks in Japan I&#39;ve noticed that it&#39;s fairly rare to find a place like Ty Harbor.   Specifically the outdoor seating.  Ty Harbor has a massive outdoor area and it&#39;s clear that the people of Tokyo love it.  We went at lunch on a weekday afternoon and it was completely packed with about a 20 minute wait. Regardless we waited because it was a gorgeous day. <br><br>I sampled the IPA and the ale and both were pretty respectable. My wife had the wheat which was also ok. I would have liked to try more but they took last order at 2 in the afternoon which seemed pretty lame considering how busy they were and how beautiful it was outside. <br><br>For food I went with the shrimp and avocado sandwich and that was tasty. Especially the bread that it is made next door. My wife went with the quesadillas and they seemed ok. <br><br>Price was they were a little on the pricey side, but that&#39;s ok because it was worth it. <br><br>Location wise, it&#39;s close to the harbor, so it&#39;s not that easy to get to from Shinjuku or Shibuya, but it was worth the trip.",
