"reviewcomment":"When you miss the taste of fruit, you should visit here.<br>Basically only women can eat there and men accompanied by women only can enter the shop. This is a good excuse to ask a girl out! lol<br><br>There are two choices; &#39;parlor&#39; which is a café style and &#39;bar&#39; which is all-you-can-eat. In Japan we call all-you-can-eat &#34;Viking&#34;. I have tried the Viking style. There were other dishes besides fruit so I could have a light dinner and enjoy a lot of fruit.<br><br>The webpage says you should make a reservation and that the seats are often full, but you still have chance. You can enter easily even without a reservation if you shoot for a time that is less crowded (like around 4 p.m.). Of course, that should be your last resort when you can&#39;t reserve a seat.",
