"reviewcomment":"Visits: 1st<br>Rating: 5*<br>Service: excellent<br>Dishes: Omakase (fresh market seafood caught/bought that morning) Y3,500/person<br><br>In Tsukiji Market a few shops down from Sushi Dai. I figured, these chefs are all getting the same seafood from the same market &amp; they serve it raw. Why wait 3-4 hours at Sushi Dai when the line in this one was much shorter? Would have been 1.5hr-2hr wait if it weren&#39;t for them pulling us out half way through due to me &amp; the wifey only having 2 in our party while everyone ahead had more. They only have a total of 8 seats in the restaurant. Yay.<br><br>Amazingly fresh &amp; sooo good. The difference is that the fish here (even though they can be the same species) have different diets &amp; for some reason their meat is more sweet than those in the states. Not to mention extremely fresh. Worth the wait for sure. Oh, their Miso Soup is full of yum as well. Had pork slices in it. Mmm.<br><br>Uni is the most creamy &amp; subtly more sweet than any we have eaten before. Must try the Uni.<br><br>The Shrimp (sashimi style) was also sweet as well. Delicious. Wifey usually cringes at the thought of eating raw shrimp but she loved every bite of this one.<br><br>Any of the white fish sashimi they had were great &amp; delicious. So soft tender melt in your mouth good.",
