"reviewcomment":"A restaurant on the river, facing the water, with boats for rental? Who wouldn&#39;t love to go to a restaurant like that? <br>My office is really close to Canal Cafe I would come once in a while. Maybe more so in spring because it&#39;s has a spendid view of the cherry blossoms. Along the river are a row of large cherry blossom trees. Having said that, Canal Cafe is at their busiest during that time. There are long queues outside during the cherry blossom season.<br>I&#39;ve only been here for lunch but they have about 3 lunch sets. You can choose to have a sandwish, a pasta or a curry set and they all come with a great all-you-can-eat salad bar.<br>Extremely, popular for ladies who lunch and couples and young families comes to enjoy a row on the boats.<br>On weekends, I would sometimes see wedding parties held here too. It&#39;s also a great place for happy hour before you head off to another place for dinner. Just make sure it&#39;s not in the summer otherwise you&#39;d get bitten by all the mosquitoes.",
