"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ap9UxgZGYadw5Pnikf_Spw/l.jpg",
"rating":"3.5",
"reviewcomment":"I first ate at this Bills a few years ago, before all the hype surrounding their Harajuku store.<br><br>Even then, late in the afternoon on the weekend, they were crowded. Luckily, nothing like the wait for the Harajuku store! I hear that line can take an hour or two sometimes. <br><br>I love the look of the restaurant. The look is distinctly beach-y and the white wood and furniture add to that vibe. The day I went there the weather was nice enough that we were able to enjoy the meal outside on the deck and look at the Odaiba &#34;view&#34;. For Tokyo, it&#39;s a nice waterfront restaurant.<br><br>Bills is famous for their rich ricotta pancakes. I recommend that if you really want to try this bite of fluffy carb heaven then you should try this location instead of waiting for a spot in Harajuku. By the time you come out to Odaiba, it&#39;ll basically be the same wait time - plus, this way you can enjoy the seaside view.",
