"reviewcomment":"Obviously, it won&#39;t be a cheap night out. The tickets to get in is for the show but drinks and food are separate.<br>It is definitely worth every yen for the music but I can&#39;t really say the same for the food. It&#39;s pricy yet it&#39;s really not that special. I guess you can&#39;t expect much because it&#39;s music you&#39;re there for but still, if you can&#39;t manage something decent then I rather you just serve fries and sausages. <br>Here&#39;s my tip:<br>1. eat before you go and just enjoy nibbles and the drinks while you enjoy the show.<br>2. get there a littler earlier to get a good seat up the front.<br><br>Food aside, you&#39;ll be sure to have a lovely night at this intimate jazz bar.",
