"rating":"4.5",
"reviewcomment":"Great sandwiches with a pretty sweet view!<br><br>If you&#39;ve had a busy day out in Odaiba and are craving a spot to look out on the water and enjoy a hearty sandwich or burger this is the spot! Not to mention they have some pretty amazing french fries.<br><br>Kua&#39;Aina is a Hawaiian burger/sandwich chain and each store is pretty similar. Good food, Hawaiian vibe, and overall friendly service.<br><br>The burgers/sandwiches are considered pricey by some, but I think its reasonable for the volume quality. My personal favorite is the avocado sandwich... They don&#39;t skimp on the avocado and you get a good ratio of filling to bread. (Something I find many Japanese sandwich places to be severely lacking)<br><br>They also have guava juice. I tend to get this while I&#39;m here and keep the &#34;Hawaii&#34; vibe going :)",
