"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/SEewSsHUJo_H5YPNEQW_8w/l.jpg",
"rating":"4.0",
"reviewcomment":"Now you can have the yummy Clinton Street Baking co. pancakes in Tokyo too!<br><br>I visited this newly-opened Tokyo branch as soon as I heard the news.  The first time I visited was about 4 pm, and the restaurant was about to close because they already sold out everything!  The second time, to my surprise, there was a long long line outside the restaurant.  After waiting for 20 minutes, I didnt really move forward a lot, so I talked to the restaurant manager and was told to try the early mornings again.<br><br>They are right.  I didnt really wait and entered the restaurant smoothly.  I ordered the famous blueberry pancakes asap.   And my kids ordered their favorite eggs benedict.  The blueberry pancakes are as truly delicious as I remember, and I l always love their eggs benedict which is with my favorite scone instead of English muffin.   A nice varieity of menu choices, everything is worth trying but just keep in mind that maybe a bit big portion than Japanese meal size.<br><br>The American coffee is nothing special but nice sip.  Dont forget the free refill and have a good time!",
