"reviewcomment":"I used to come here for the cheese, but I couldn&#39;t find any today. They still had pickled herring and lingonberry juice and jam!<br>I had only seen huge blue IKEA bags in Canada, but there&#39;s a miniature version here. I got it here in the food market, and use it for my regular grocery shopping!<br><br>They have ceiling lights for the snap-in brackets that are most common in Japanese dwellings. I found some that are quite cheap. However, they don&#39;t carry any with switches. I can only use IKEA lights for my entrance, since that one has a wall switch.<br><br>10:30 was still OK on a Saturday, but the throngs had come by 12 and I decided it wasn&#39;t worth it to try to get a hot dog.<br><br>They have free shuttle buses from Denenchofu Station (Tokyu Toyoko Line/Tokyu Meguro Line) and ShinYokohama Station (JR Yokohama Line/Yohokama Subway Blue Line). In the summer of 2013, they also had shuttles from Yoga Station (Tokyu DenenToshi Line), though I don&#39;t know if they plan to do that again.<br><br>The delivery service is contracted out to a takkyubin courier service (Sakawa Kyubin&#39;s Moving division, I think). They charge by weight class. I found it helpful that the box labels had weights written on them, so I could calculate whether I should carry the small stuff home or throw it in with the rest, if the total would still be in the same bracket.<br><br>The layout of the store was similar to newly built/renovated IKEAs I&#39;ve been to in Canada, with a huge cafeteria on the second floor.",
