"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/XNi3hp7meHfWXzHowqdLgw/l.jpg",
"rating":"5.0",
"reviewcomment":"Au Bon Vieux Temps<br><br>I was just checking out my feed and this popped up as one of the top places being reviewed in Tokyo. <br><br>As you may all know, Tokyo&#39;s one of the biggest, if not the #1, hotbed of amazing pastries. I wouldn&#39;t consider myself a &#34;sweets&#34; expert. But I feel like I&#39;ve had a pretty large share of pastries from fancy places located in ritzy neighborhoods like Ginza whose primary focus is on the aesthetics and presentations, rather than quality. <br><br>Located in Oyamadai, on the main strip that connects the train station and Kanpachi, this place has a pretty unassuming appearance. Like, it&#39;s one of those hole-in-the-wall neighborhoods spots that you would miss if you were just walking by. Don&#39;t let the exterior fool you. This place, hands down, is one of the most legit patisseries in Japan. In fact, a lot of young aspiring patissiers come from all over the country to learn the secrets of pastry making at Au Bon Vieux Temps.<br><br>You can&#39;t really go wrong with anything here. Ice cream is legit too. They also serve breakfast specials with coffee / tea and quiche.<br><br>If you really want to experience the art that is Japanese pastry making, you need to check this place out. This place is no joke. It will definitely go above and beyond (most) everything you&#39;ve had before.",
