"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/pZrxCf14ozByR8ZF8ETW5A/l.jpg",
"rating":"5.0",
"reviewcomment":"About a two and a half hour wait in line from 6:00am-8:30am. Being in line that long was painfully slow, but it was absolutely worth the wait!<br><br>After a fun tour of the early morning tuna auction, my boyfriend and I went in search of this famous sushi restaurant that is probably listed in everyone&#39;s guidebooks and websites. We got to Building 6, and saw the long line spanning the block waiting to get in at 6:00am. That morning (I&#39;m not sure if it is always like this), the longer line was for Sushi Dai, and I wonder if it is because it is closer to the street and visible. There is also Daiwa Sushi just a few doors down which is also famous for its sushi, but the line was much shorter. We decided to wait for this one.<br><br>The wait felt long, but a woman taking note of the people outside was kind enough to offer some green tea while taking our orders ahead of time.<br><br>My boyfriend and I got the Omakase set. It is a fun experience and because it is the chef&#39;s choice, you won&#39;t get the same pairings as your neighbors who are being served by other chefs. The sushi obviously lived up to our expectations. Our favorites were the horse mackerel (paired with ponzu), the sea eel (ooooh melty goodness!), and the fatty tuna. It was awesome. You&#39;ll be sitting at the end of your meal, having a hard time deciding what to tell your chef what will be your last choice onigiri!<br><br>The chefs openly welcome their customers in a limited amount of English and in other languages, probably from the amounts of foreigners that come in. The chef that serves us was able to explain the types of fish in English and also in Chinese for the people sitting next to us. I thought it was a nice gesture and something I didn&#39;t encounter anywhere else.<br><br>I&#39;d have to say this is the freshest sushi meal I&#39;ve ever had, touristy or not. Absolutely worth the wait! Enjoy, everyone!",
