"reviewcomment":"One of the best Yoshoku style restaurants. Beef steak, hamburug, ton-katsu, omu-rice, ramen noodle etc.. <br><br>All of them are well. Omu-rice, chicken ketchup fried rice covered with omlette is especially famous. worth to eat once during your stay. <br><br>I like ramen soup noodle. Very simple soy sauce taste soup. It cost just ¥650.   <br><br>you have to be on line at the evening time in the weekend.<br><br>オジサンさんに聞くとエビフライ発祥の地だそうです。いまの店主は三代目。日サロ、ガングロ系でよくブラウ­ンシゲル様とテレビに出てる。<br><br>たいめいけんのエビフライは、曲がってないのが特徴ですよね。まっすぐ。調理するときに切れ目を入れてるか­ら。<br><br>みんなオムライスを頼んでるけど、あたいは絶対ラーメン派。ここのラーメンは、今じゃ絶滅種の東京醤油ラー­メン。出汁がきいてて美味しいの。<br><br>それに安いし。今日も感謝。ご馳走さま。",
