"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/rbjfQPxIznSi7zaGbZv92g/l.jpg",
"rating":"4.0",
"reviewcomment":"I love this local soba place. Apparently, it&#39;s actually quite popular with the celebrities and it&#39;s a place to be. It&#39;s just 15 mins from my apartment so I sometimes drop by after a night out drinking with friends. This place is only open at night and doesn&#39;t close until 4am; a rarity in the area.<br>The restaurant is designed in modern Japanese style with dark, long wooden tables and the chairs are smooth wooden logs.<br>You can choose your the thickness of your soba; I&#39;m a thin soba gal but you can also choose to have fatter soba noodles.<br>On a late night, when I&#39;m trying to be health conscious (who am I kidding, drinking until 2am is already unhealthy), I would order a cold plane soba with seasame dipping. <br>On a night when I&#39;m way too drunk and just want to stuff my face, I&#39;d order the hot soba with duck and have an extra order of hot egg roll (dashi maki tamago). Their egg roll is excellent and extremely fluffy and delicious!<br>If you&#39;re still hungry, do try their mince chicken balls (tsukune). It&#39;s super yummy too!",
