"rating":"3.5",
"reviewcomment":"Going to Akihabara without visiting the Gundam Themed restaurant is a definite faux paux. From my Experience they weren&#39;t really English friendly, despite being a largely popular destination for tourists, but the menu is easy to understand and the majority is in Katakana. It would be unfair to criticize them for lack of foreign language skills <br><br>I ordered a rice meal set with grilled chicken and a gundam themed treat for dessert. They have meal sets that include a cocktail and a gundam theme cup you can take home. Their meal portions are quite filling, I managed to only just finish the entire meal. <br><br>The quality of the food is good, it&#39;s better than fast food but a quick walk down the street will probably mean better food. When visiting this place you are more so coming for the experience and gimmick of a themed  meal. It is still most definitely worth it.<br><br>If you happen to come to this cafe, visit the toilet and push the big red button.",
