"reviewcomment":"So much hype, so little substance. Bills claims to make the best breakfast in the world, at least that&#39;s what they aspire towards. But the world&#39;s best breakfast they are not, not even close.<br><br>After waiting in line for around 40 minutes, I was seated. Starved and filled with anticipation, I scanned the menu then settled on the Full Aussie Breakfast and a Long Black.<br><br>The Long Black (480 yen) came in a tiny cup and tasted like crap. It&#39;s difficult to respect an establishment that can&#39;t make a decent cup of coffee.<br><br>Next is the Full Aussie Breakfast (1700 yen) which left me far short of full. I expected a Full Aussie breakfast to be hearty, and it sure wasn&#39;t. The portion was tiny, just like the coffee. The only element worthy of mention was the scrambled eggs, which was decent.<br><br>In summary, Bills fails miserably to provide even a decent breakfast not to mentioned being way overpriced for what you&#39;re getting.<br><br>Oh, did I mention that the coffee sucks?",
