"reviewcomment":"This Iseya yakitori shop in Kichijoji has been there since 1928.  I have been coming to this location for years now.  There are 3 of them in the area but I like this one better because it is closer to the JR Kichijoji station.  The other two are closer to the Inokashira Park.  Every time I am in Tokyo, I make it a point to stop by here and eat some yummy dirt cheap yakatori sticks.  The menu is basic, mostly yakitori items from the carcasses of pigs.  The sticks are ¥80 each (cheapest in Tokyo?) Their homemade shumai is also a treat. The yakitori smoke inside the shop is insane and with very poor ventilation.  The windows are usually all steamed up from the heat as well. Don&#39;t sit at the counter seat, you will get direct yakitori smoke with full force from the grill.",
