"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/OmnmEcAZOCDVS-TALZzpvQ/l.jpg",
"rating":"4.5",
"reviewcomment":"This is the sort of place that a native introduces you. If you&#39;re very, very lucky, you&#39;ll randomly run into this place, but it&#39;ll only be because you got lost on your way to Harajuku. Thankfully, we had a native take us. (But that doesn&#39;t mean I didn&#39;t get lost in Harajuku.)<br><br>Omotesando&#39;s the sort of neighborhood I want to raise my children. I don&#39;t have children, but if I did, this is where I&#39;d want to live. It&#39;s kinda like Noe, without the hills, and the yappy dogs, and the random tech--actually, it&#39;s nothing like Noe. There&#39;s no comparison.<br><br>Anyway, it&#39;s got this lovely coffee shop: Omotesando Koffee. You enter, you order a cup, and a man in a starched white lab coat artfully prepares your beverage. (<a href='http://www.yelp.com/biz_photos/%E3%82%AA%E3%83%A2%E3%83%86%E3%82%B5%E3%83%B3%E3%83%89%E3%82%A6%E3%82%B3%E3%83%BC%E3%83%92%E3%83%BC-%E6%B8%8B%E8%B0%B7%E5%8C%BA?select=RgxHYiCC2iC12CtWyMDfPg#RgxHYiCC2iC12CtWyMDfPg'>yelp.com/biz_photos/オモテサ…</a>) He takes time and care into each and every cup. He stirs the milk tenderly. He handles the espresso with ginger care. He hands you your drink with two hands. It&#39;s a show, but it&#39;s not: it&#39;s how he makes his coffee. And it&#39;s delicious.",
