"reviewcomment":"¥200 for cookie filled with sweet beans. Eat on the road is the Ningyo cho style. <br>You have to wait on the line at least 20 minutes to get. <br>Tai-yaki represents the shape of this cookie. It baked with the fish shape, snapper. Japanese words for tai reminds most of Japanese &#34;happy&#34;.  Tai-yaki is like a casual sweets for wish you happy.   <br>Closed on Sundays. <br><br>柳屋の鯛焼きは、まず皮がうまい！アンコもサッパリめ。粒餡。<br>並ぶの必至ですが、注意点は、列が短くてもスグ順番が来ないこと。一度に20個買う人とかがいるので、あと­3人とかのときに、そんな人がいると、とてもガックリくる。手作業で作ってるので、一度に5個くらいしか出­来上がらない。<br>日曜休み。ある意味、甘酒横丁で一番客に愛想の無いお店。",
