"reviewcomment":"Just my personal opinion -- Tsukumo used to be my favorite ramen restaurant until I noticed the strong chemical boric-acid-like smell of the noodles about two years ago (the smell when you fry or boil the food containing borax).  I tried many times but sadly the noodles just smell -- maybe I&#39;m too sensitive, or its not borax problem but the noodles smells chemicals somehow.  And they stop providing free toppings any more (like spicy bean sprouts, fresh green onions, and spicy leaf mustard).<br><br>Except the noodles, I do love Tsukumo -sniff-- the pork ramen and the famous cheese ramen are both good.  The soup is rich and creamy, the 70th pop music is good, and the waiters are very friendly, too bad that its hard to find other ramen restaurants offering cheese ramen since Tsukumo seems to take out a patent on their Marukyu Cheese Ramen.  I personally sincerely wish Tsukumo would improve the noodle problem and I&#39;d definitely frequent Tsukumo like before!!",
