"rating":"4.5",
"reviewcomment":"Looking for a nice breakfast/brunch restaurant?  You must try Le Pain de Quotidien Shiba Park!<br><br>Le Pain de Quotidien Shiba Park is a spacious restaurant with a nice green view which you can hardly find in central Tokyo. There are mainly three areas in this spacious restaurant; bakery, outdoor patio, and inside tables.  I especially like the outdoor patio, feeling relaxed to have a good brunch with summer breeze, seeing Tokyo Tower and Prince Hotel nice greenery garden. <br><br>Le Pain de Quotidien is a famous Belgium bakery specialized in bread made with organic ingredients.  So the restaurant menu is mainly focus on those go well with their bread.  I especially like the breakfast menu, various kinds of egg dishes.  And you can see the bakers making fresh bread through the glass wall; my kids love it.  And also there&#39;s free jam and dip for you to try with the bread.  Don&#39;t forget to get some bread from the bakery before you leave --  they have the best organic bread!!",
