"reviewcomment":"Being Hong Kong -born I am very picky with chinese food, it&#39;s only naturally really but when I crave for a little taste of Hong Kong, I would come here.<br>For what they serve here (wonton noodles, charsiu rice, small dim sum dishes), it&#39;s a little pricey and I can&#39;t say this place represents Hong Kong, however, it will do when I&#39;m dying for some congee.<br>Yes, when I come, I would usually order myself a simple bowl of congee, a small plate of steamed pork and maybe the pork dumplings. Maybe also come for the wonton noodles, spring rolls and their siu mais as well. <br>It&#39;s a dainty little place to hang out for a nice beer and a nibble if you are around the Mishuku area.",
