"reviewcomment":"Great hidden spot but that is all I can really say for it.<br>I&#39;ve always been curious about this cafe ever since it opened, I literally walk pass it every day. <br>Finally, one day, I managed to fit in time for coffee with my friend and I suggested we try it out.<br>The large glass door leads you up the stairs where the cafe is. It is the second floor of an old house filled with used leather sofas, wooden tables and chairs. The space by the walls are used for small exhibitions as well.<br>I wonder if their air-conditioners are part of a collection because they have a whole wall of them. Go check it out.<br>This is a great place for a quick catch up and meeting, if you are a smoker...if not, then you might catch yourself smoking second-hand ones anyway.<br>The sofas were quite wore out to the point where the springs inside was poking at me. And the coffee wasn&#39;t great either...<br>But I was only there for a quick catch up so I thought I&#39;d try again and see how their are food are.<br>Last week, I was there and with friends (this time I choose to sit on the wooden chairs instead... you know what, just go on weekday when there are few customers and enjoy a good read with tea in the corner.",
