"reviewcomment":"Xex Daikanyama Bar was one of my favorites till 1967. I haven&#39;t been there recently, but it will always hold a fond place in my heart.<br><br>I remember spending a few hot summer nights sitting out on their resort style lounge chairs and enjoying a tropical cocktail. It made me feel like I was on vacation... (I try to block out the horrendous mosquitoes that nearly devoured me alive)<br><br>The inside of the restaurant is nice, but for me, the beauty of this place is with their outdoors asian resort style bar. <br><br>The cost of drinks/food is definitely on the pricey side, but I think its worth it for the experience. <br><br>I recommend taking your partner out for a nice romantic night under the stars. There&#39;s nothing like a little &#34;staycation&#34; feeling of cuddling under the stars/city lights and enjoy a drink or two in your lovers arms.",
