"reviewcomment":"Jojoen Yugentei is the most luxurious and decorative interior one among Jojoen chain restaurants I know.  And of course they offer yummy yakiniku -- a perfect place for meat lovers! <br><br>Comparing with the outsides of ordinary building, the interior inside is just luxurious.  Yakiniku restaurants tend to be smoky and loud, and apparently Jojoen Yugentei has not only good grill equipment but also good range hood equipment.  The dinner menu is diverse and surely delicious, while I highly recommend the lunch value menu which is provided from reasonable 900-3000 yen, with choices of yakinikh rice bowl, and grilled yakiniky set, etc.  Yummy!<br><br>Except the yakiniku, I personally love their Jojoen salad, and my kids love their dessert, the heart-shaped green tea flavor ice cream with smily face on it.  Better make reservation in advance. Various choices of private rooms.  Delivery service available of yakiniku obento coming along with pickles, sweet beans, and Korean kimuchi.",
