"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/03nImSD0vsVQfuPHFEKwFQ/l.jpg",
"rating":"3.0",
"reviewcomment":"-FRIJOLES, FRIJOLES, FRIJOLES...The &#34;Wanna-Be&#34; CHIPOTLE of the East!<br>I must admit, my taste-buds were really excited until you sent them home with BLUE-BALLS!<br>-The SALAD WRAPS...cough...cough...I mean Burritos are what you would expect from a &#34;Wanna-Be&#34; CHIPOTLE joint. Don&#39;t expect a CHIPOTLE burrito, but do expect a FRIJOLES Burrito. Basically the process is the same as CHIPOTLE, but the end result is a COLD SOGGY BURRITO overly wrapped in foil(I don&#39;t know why, if the the burrito is cold), stuffed with rice and lettuce, showered with the salsa of your choice, a little sour cream, a couple sprinkles of confetti sized cheese and a FEW SCRAPS of MEAT. You can add a pinch of guacamole for an extra charge. <br>-FRIJOLES is definitely not the worst burrito I&#39;ve had in Tokyo and most certainly not the best. Go ahead and give it a try if you&#39;re really craving a burrito and if you&#39;re nearby.",
