"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/gRAFIDnnaK0cVI4BRfoTKQ/l.jpg",
"rating":"4.5",
"reviewcomment":"The galettes here are the best in town!<br>And the location is just perfect! This tiny French creperie is located off the main street in beautiful Kagurazaka, down a tiny cobble alleyway. My whole team likes to come here for lunch once in a while but since the restaurant is petite we usually book early and have a quick brunch. I would like to come and take my time one evening and enjoy myself.<br>Usually, I&#39;m here for the salad set where you get a salad (duh), a choice of savoury crepe and a drink. When we&#39;re not in such a rush, I&#39;d order the set with also a dessert crepe. <br>There are so many flavours to choose from but my recommendation is the mushroom and cheese creperie. The cheese is always crispy and chewy and the mushrooms are juicy and mixed perfectly well with the cheese the crepe which are made of 100% buckwheat flour. <br><br>Tip: The terrace seatings are perfect during spring and autumn.",
