"reviewcomment":"Great brunch or date spot.<br><br>The restaurant is housed in a very cute and airy looking white building. It has a nice fireplace and an open feel - almost like you&#39;re in a weekend lodge.<br><br>If you get the special &#34;date spot&#34; in front of the fireplace... sharing some wine and cheese... you can imagine that you&#39;re on holiday somewhere and not in the heart of Roppongi!<br><br>The restaurant is very popular with women - I think my guy friends find the portions a bit too dainty. Overall the food is good, but I think I would choose this place for its atmosphere over the food. (That being said, I haven&#39;t tried the French Toast, and people say that&#39;s the best item on the brunch menu) <br><br>EDIT: I went to Mercer recently and tried their French Toast... oh wow! I&#39;m not usually a fan of french toast but this was the best french toast I&#39;ve had in Japan. Moist yet crunch on the outside. I believe they use brioche bread and it maintains its sweet flavor and moistness, so that it doesn&#39;t even need syrup. I&#39;m definitely going back for more (and asking for them to make all sides golden).<br><br>Mercer Brunch has terrace seating and you see many people enjoy the outdoors on sunny days (despite being located on the side of the road). <br><br>The large sun umbrella in the corner a nice touch. Maybe that&#39;s why I feel like I&#39;m on holiday when I head there!",
