"categorystrlist":"American (Traditional)",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/RORhb39pX__Ghuqsq5QUqw/l.jpg",
"rating":"4.0",
"reviewcomment":"So many people may think that going to an &#39;American&#39; restaurant in Japan is a waste. I say poo-poo to them!<br><br>TGI in Japan has many Japanese themed and inspired dishes- it won&#39;t compare to an authentic Ramen shop, or a little Yakitori stand but it&#39;s english friendly, and good for a hearty meal.<br><br>You can choose smoking or non smoking which is handy for a non smoker like myself. You will find that most traditional places won&#39;t have that option. It&#39;s Smokin&#39; or nothin&#39;<br><br>The lunch menu came with a free soup and side of rice, I had so much food I didn&#39;t know what to do with myself, I couldn&#39;t eat it all! Lil ol&#39; Tiffy just doesn&#39;t have a stomach that big! Still that PLUS free drink refills for ¥1000 approx is pretty good!<br><br>I ordered the lemon chicken, however last time I had Yakitori and it was the winner between the two, Yakitori is not on the lunch menu however.<br><br>Lunch is from 11am - 2pm<br><br>This TGI FRIDAYS is open till 1am and located down the side street in Ueno on the 2F!",
