"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/pTitEf6O7vxnNtU6spn3cQ/l.jpg",
"rating":"4.5",
"reviewcomment":"When I used to work in Sangenjaya my lunch breaks were only 40 minutes. With so little time, I&#39;m usually confined to convenient store food or fast food chains. Every once in a while I&#39;ll treat myself for a quick bite at this Vietnamese hawker&#39;s shop.<br>If you have been to Sangejaya you will have most definitely have walked pass this shop before as it is right above the station and just next to MacDonalds. Covered with curtains, this little shop is a runned by a nice and friendly guy who stands behind a corner in the tiniest kitchen I have ever seen. With 2 small tables and 1 counter, the shop can seat about less than 10 and it would be helpful if you return your dishes back to the counter and help the owner out. There&#39;s about 10 or so items on the menu but I would highly recommend the Vietnamese beef pho. The lemon and coriander is always refreshing with the heartwarming beef broth and pho.<br>The perfect bowl on a cold winter&#39;s day.",
