"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/1q1p8Hcx16QY1vKEU8rwhg/l.jpg",
"rating":"4.0",
"reviewcomment":"If only Brasserie Gus isn&#39;t so hard and far to get to. I so wish it&#39;s in my neighbourhood, I&#39;d make myself a regular in no time.<br>I was here with the girls at work and it&#39;s the perfect place for a small gathering. It&#39;s hard to find a French bistro that is so good yet so affordable. I date even say cheap! For the quality they serve out, this place is damn cheap! <br>The restaurant used fittingly cute bistro style red and white table clothes and has the most adorable animal-shaped cutlery holders.<br>We each ordered a starter, a main and dessert and shared a bottle of 2 together. My beef cheeks in red wine was tender and delicious and the bed of mash potatoes it sat on was just so creamy and comforting.<br>The night we were there, there was large party of maybe 10 taking up half of the restaurant and on our way out, one of the ladies from that table who was coming back from the bathroom tried to walk pass us but instead got so happily drunk that she lost her balance and fell down right in front of us. <br>For whatever strange muscle in me, I tried to catch her and lifted up my thigh (or knee) as  a cushion when she fell while one of my girlfriends tried to catch her too.<br>The waiter was in more of a shock than us and somehow we took control and directed the waiter to get towels, water and a few chairs for her to lie down a rest. <br>My knee was quite bruised later but I&#39;m sure we were pretty satisfied ourselves for helping someone out because as far as I can remember we than went on to at least 2 more places to drink the night away...",
