"reviewcomment":"I&#39;ll be honest, I boycotted this place for so many months until I said to myself....&#34;fooockkk it&#34;!!! I&#39;m craving a cookie so let&#39;s give this place a try! <br>So here it is.... The line to get a cookie is not bad. While you are in LINE the staff walks around giving sample cookies for you to taste! And ohhhh SH@t! These cookies are right out of the oven, soft and gooey! Fockkkken delicious cookies!!! This place is LEGIT! Next....I ordered a vanilla cookie shake, an icecream sandwich, and a cookie/coffee combo. <br>So here&#39;s the low-down...<br>-Vanilla Cookie Shake- it delicious and very Cookie-ish! Size is good as well as the price. <br>-Icecream Sandwich- is pretty small, a little pricey for the size but, it&#39;s very delicious! <br>-cookie/coffee combo- you are better off ordering these items SEPARATELY!!!! And the reason why!!!! Actually, before anything the coffee sucks! It&#39;s freakin BITTER! And the cookie you get is probably the size of a COKE BOTTLE CAP!!!!!!! <br>- Final thought....the cookies are LEGIT and foocken GOOD! My only issue is the size compared to the price! For example if you go to STARBUCK or even MAX-BRENNER down the street, for about the same price as cookie-time, you can get a cookie that is twice as big and equally as delicious!!!! When Cookie-Time decides to make bigger cookies or lowers the price I will give this place an EXTRA STAR!",
