"rating":"4.0",
"reviewcomment":"Kimukatu is one of my family&#39;s favorite Tonkatsu restaurant in Tokyo!<br><br>Except the ordinary traditional Japanese Tonkatsu (which means deep-fried porklet in Japanese), Kimukatsu offers contemporary 25-layered millefeuille style Tonkatsu which is extremely juicy and yummy!  And there are 7 kinds of filling you can choose, like cheese(my favorite!), garlic, green onion, plum and shiso leaf, etc.  All set comes along with pickles, cabbages, rice and soup.  And their dark miso soup is super yummy too!  I also highly recommend their seasonal course menu, which you can enjoy not only Tonkatsu but also various kinds of vegetable dishes which go perfectly with liquor!  Btw, 1300 yes all-you-can-drink menu available.<br><br>The only thing is there&#39;s always a long line waiting.  But the waits worth!",
