"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/VXneQMTk9_IU6ogdo1EUhQ/l.jpg",
"rating":"5.0",
"reviewcomment":"Ninja is a themed restaurant all about the magic and mystery of the Japanese Ninja! It&#39;s a really awesome place to visit, it&#39;s amazing how much detail there is in the restaurant. Right from the entrance you get this feeling of mystery as the restaurant is kind of dark and secretive, but it&#39;s still very popular. It&#39;s very much like a Ninja&#39;s hiding place. The Staff are very funny and they look so cool, they take photos with guests as well and are really interesting to talk to. The food is great, it&#39;s quite expensive, but it&#39;s all for the show and the good quality of the meals there. It really is an amazing experience, I can&#39;t really say I&#39;ve ever been surprised by a Ninja when leaving the restaurant before! It was really funny, and I laughed a lot after that. I would definitely go again and enjoy it with a big group, please visit this restaurant if you can!",
