"rating":"4.0",
"reviewcomment":"Delicious authentic Japanese cusine.  This shop specializes in making fresh panko fried foods - from porkchops, shrimp, potato, beef, etc.  If you are lucky enough to read the menu, you can also get non-panko coated panfried pork chops, but their specialty is the fried pork cutlet.  <br><br>We asked our hotel concierge where to go, and they reccomended this place.  There was a line out the door of locals, so we knew we were in good hands. The line moves quickly, so don&#39;t be afraid.  It is worth the short wait.<br><br>Each meal comes with shredded cabbage, and the sesame dressing is on your table to drench as much on as you want.  The dressing is fantastic.  At each table is also a jar of pickled veggies, which reminded me of my childhood. We were not able to read the menu, so we pointed at the pictures, unsure of what was inside the fried shape, and we were not disappointed.  We got a porkchop for one meal, and the 2nd meal was fried creamed potato with a beef patty.  We also added two fried shrimp a la carte.  The shrimp was so much better than shrimp tempura!  You must add shrimp to your order.",
