"rating":"3.5",
"reviewcomment":"Excellent sushi place in terms of quality and price from a close friend that frequents Japan. Despite being a franchise/chain, said friend states the consistency of sushi is excellent here. <br><br>Oh boy the fish. Excellent fatty tuna set, a must try. Individual pieces of:<br><br>* Yellowtail - Excellent<br>* Flounder Fin - Too rough of a texture and bland for my personal tastes<br>* Fatty Salmon - Excellent<br>* Premium Eel - Excellent<br>* Scallop - Soft texture and was not really expecting it. Supple taste of the scallop and not my usual cup of tea.<br><br>I really took the time to eat slow and savor the pieces to recognize and appreciate the differences from other countries and sushi joints between both coasts in the states.<br><br>Did I mention this place is open 24/7 AND takes credit cards?!",
