"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/wRzYoXA1U8aQ4u4Lqx-N-w/l.jpg",
"rating":"4.5",
"reviewcomment":"Urth Cafe Tokyo - Transported directly from the streets of LA.<br><br>Honestly, entering this store I felt like I was transported into their US location. The displays, water area, smells, and even their bathrooms look like the US! Not to mention the amazing pastry/cake display that your eyes feast on when you walk in. <br><br>The store is located in the super chic neighborhood of Daikanyama and is open and spacious. They even have outdoor seating.<br><br>Urth is famous of their organic and healthy drinks and food. They offer a wide range of coffee, juice, smoothie, and boba filled teas. <br><br>Their menu is heavy on the breakfast options (granola, oatmeal, eggs, breakfast burritos etc.) but they also have a nice selection of sandwiches, paninis, and amazing salads.<br><br>Personally, I love their entree salads. I ordered the chicken salad and was pleasantly surprised (kinda shocked) at the amount of protein and vegetables that arrived in front of me. Initially I found it a bit pricey, but for the amount of food, I think it&#39;s well worth it.<br><br>I recommend checking out this restaurant if you&#39;re craving a dose of LA, US portions, healthy protein/veg combo... or are craving one of their decadent cakes. Whatever the reason, I highly recommend this joint.",
