"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/MTyEZbWVFrjr5oZrUJ-WBg/l.jpg",
"rating":"3.5",
"reviewcomment":"Xiao long bao. It&#39;s so fun to say. XLB is Taiwanese food but what my first review for Yelp Japan is about! I love the warm soup that gushes in your mouth as you eat the dumplings and the vinegar sauce you dip them in. <br><br>I flew to Japan for a day to eat Taiwanese dumplings. Does that sound crazy? Nah...what was crazy was the line. This location is in the Takashimaya Department Store in Shinjuku. The line for a table was a bit daunting and wrapped around the corner but actually moved way faster than you would have thought (we came at 2pm). We chose to sit outside even though it was a little nippy so we could get seated faster. It was cute, they had a bunch of blankets to cover your lap.<br><br>Din Tai Fung is obviously known for their dumplings. My friend and I decided to get a lunch special for about 1659 yen with beef noodle soup and xiao long bao. The xiao long bao was really good. The dumplings were a good size and the soup in the dumplings were warm and not too hot. The beef noodle soup was ok but not something I enjoyed too much. The broth was really heavy and a bit greasy for my taste. <br><br>The lunch special came with two desserts. We got a mango and a berry dessert which were good but nothing special. <br><br>I know Din Tai Fung has tons of locations in the world, of course not in Hawaii. I definitely wouldn&#39;t mind coming back for to try a different soup and more xiao long bao. Happy slurping.",
