"reviewcomment":"I&#39;ve always tried as many restaurants in Yokohama China Town as I can, but it always ends up with I go back to Saiko Chinese restaurant again.<br><br>The problem for my family is that we like Chinese food a lot, but not too oily Chinese food.  And Saiko offers comparatively healthier food like Yumcha, and the dishes are beautiful!  We especially Iike the steamed dumplings here, either meat filling or sweet bean curd filling.  <br><br>Unlike most frozen food in China town, you&#39;ll easy find Saiko food doesn&#39;t preserve long -- short expiry because of no preservatives!  There&#39;s a Saiko shop selling dumplings and some Chinese dessert around.  And also a bubble tea bar inside.  My kids like their tapioca bubble tea while I&#39;m a super fan of their steamed buns.  Enjoy your nice hot steamed Chinese dessert at home too!",
