"reviewcomment":"Quite possibly the best ramen I have ever eaten. I took a train from my hotel room in the Shinjuku area of Tokyo TWICE to eat this unbelievable ramen. <br>The quality of the noodles are great. I ordered them medium hardness. <br>The broth is unbelievably great. The viscosity is just bellow maple syrup and has a heartiness that will push you to the brink of passing out. For an extra ¥160 you can buy some rice to pour the remaining broth on and I fully suggest you do it. To top it all off, the pork pieces that are in the broth and so tender to the point they are teetering on the brink of being liquid themselves. <br>It is out in a more residential area of Tokyo, but I strongly suggest this to any visitor in the area to try it once. <br><br>The English address is:<br> 4-5-1 Ekoda, Nakano-ku, Tokyo<br>I&#39;ll post pictures with basic ordering instructions.",
