"reviewcomment":"Originally from Kyushu, this famous tonkotsu ramen shop has made itself a name and has build an empire with many branches all over the world. One of these are just across the road from Komazawa Park. <br>As it is close to a park, this is tends to have a more homely feel to it with customers ranging from groups of university students to small groups of families on weekends.<br>Whenever I go, I order thei &#34;Akamaru&#34;, literally meaning the &#34;red circle&#34;. This is tonkotsu based ramen with a thicker soup in a red bowl. If you have an appetite I would also recommend their charsiu rice (stewed pork on rice). Oh yes, and don&#39;t forget to add an egg as extra topping for your ramen, the runny egg yolk is too good to miss.",
