"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/BwFW9ch4j25vUbh70MBg7Q/l.jpg",
"rating":"5.0",
"reviewcomment":"If you&#39;re an espresso fan abroad, you owe yourself a trek here.<br><br>I&#39;m from San Francisco, where we smugly pride ourselves on a fanatical devotion to espresso preparation. Bear Pond is on an entirely different coffee plane.<br><br>I had read a bit about their espresso prep method -- heavily-packed portafilters with very little water, something like an extreme ristretto. Allegedly, the owner doesn&#39;t let anyone else touch the machine, so as to avoid messing with its just-so calibration. <br><br>I was excited to see the guy&#39;s technique in action, but the woman behind the counter told me I couldn&#39;t watch because &#34;it would make him nervous&#34;. <br><br>I&#39;m not sure if that&#39;s actually the case, or if they&#39;re just tired of overcaffeinated tourists -- but I liked the idea of a barista requiring that much focus. Anyway, after several (presumably) laborious minutes, I was handed my espresso.<br><br>The shot was literally only a few drops (probably 1/4 the volume of a standard shot), with the texture and flavor of dark chocolate syrup. And it was really good.",
