"reviewcomment":"Galettoria looks the part and tastes the part. The shop is a small yellowy-beige 3 storey high house 10 minutes walk from Shibuya station. The building is entwined with vines and it&#39;s as if you&#39;ve flew to Paris for a lovely lunch. The interior is done up like a rustic country home, with wooden terrace chairs, and red brick floors.<br>It&#39;s just so fitting and gorgeous. <br>I took my mum here last summer and we had a such a wonderful time. <br>We had our own savoury galette and shared a dessert crepe together. My mum had the duck with fig galette while I had the simple eggs, bacon and cheese. <br>It was c&#39;est bon!<br>My mum was too full to share the dessert crepe (bless her soul) so I enjoyed most of our lemon and honey crepe with our coffee.<br>It was really relaxing here, chatting, taking in the warm smell of buckwheat crepes with the lovely sun rays from the large windows.<br>Do make sure you get a booking because Galletoria can get really busy.",
