"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/B7gwTIEJhv2SDb_zaRxAaQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Why go here?   Good wine, service, and excellent food quality at a reasonable price (relatively speaking).<br>Ave price per person w/drinks:  25,000 Yen<br>Reservation:  Required.  Not too difficult to get a seat.<br><br>When food loving friends ask me for recommendations on a place to enjoy good wine, I usually recommend FEU.  Sure, there are numerous other high-end French Restaurants in the city that offers premium wines - but they also charge premium prices!<br><br>Don&#39;t get me wrong, this place is NOT cheap.  However, what makes this place a worthwhile place to visit is their passion to serve you good tasting &amp; interesting wines at a relatively reasonable price.  Lets face it, high-end dining in Tokyo is expensive.  When I go, I have to restrain myself from ordering nice wines, because I am already getting nauseated from looking at their food menu prices.  I usually is forced to settle with their cheapest house wine - which is often terrible.  <br>   <br>DECOR:  Located conveniently near Tokyo Midtown.  Very spacious table arrangement, especially for Roppongi area.  They could easily squeeze in a couple more tables, but chooses to keep the room spacious.  Great for dates.<br><br>FOOD:  Chef&#39;s course of the day only (I think.  I never seen anyone order ala carte).  They are very accommodating to your food preferences/allergy issues, so tell them what you CANNOT eat when you call.    <br><br>WINE:  Their wine offering is probably the main reason I keep going back to this place.  The sommeliers here work really hard to understand your wine preferences and chooses reasonably priced, yet very interesting wines.  Their offering is entirely French (sorry Napa wine fans).  <br><br>OVERALL:  So you might think I am crazy for calling 25,000 Yen dinner high cost performance, but it is.  When you compare the this place to some of the Michelin 3 Star places that could hit you for 35,000 Yen bill, this place is cheap.",
