"rating":"3.5",
"reviewcomment":"American chain steakhouse in Roppongi.  <br><br>Price:  ¥4000 per person including 2 drinks. <br>Coupon: 10% off coupon available in Hotpepper. <br><br>Yep, Japanese food is delicious.  I love it.  But once in a while, you want to reach for &#34;dashi&#34; Free-Zone.  Rest assured that Outback Steakhouse does not use bonito flakes to make &#34;dashi&#34; to prepare their food.  <br><br>Ahhha, American food.   Oh wait, where is the Outback?  Some where in Arizona?  Wait a minute, it is in Australia!  <br><br>So is this Aussie food?  <br>I don&#39;t know, because I&#39;ve never been to Down Under, but the food sure tastes American.  Their regular steak uses Aussie Beef, but their promotional dishes often uses American Beef.  I personally prefer U.S. Beef.<br><br>My favorite dishes are &#34;No Rules Pasta&#34; and &#34;Side order BBQ Ribs&#34;.  What? Pasta at a steakhouse?  It has plenty of chicken and shrimp to meet my protein needs.  Furthermore, I think that steak that I grill at home tastes 10 times better than steak here.  <br><br>SERVICE:  Sometimes, you catch them on an off day (that was the case tonight), but in general, this place provides really good American style service.  Staff is usually friendly and accommodating to various needs.  I love the flexibility that the servers provide, which you do not see in chain Japanese restaurants.  You try to tell a Japanese chain restaurant that you want french fries instead of the standard baked potato.  They are often very unaccommodating.   This place is also kids friendly, providing crayons and paper.  They have kid&#39;s meals as well.<br><br>HAPPY B-DAY:  Singing happy birthday to the table is nice...the first time around.  When you get this treatment 4 times in a night, it could get a bit annoying.  For some reason, people come here to celebrate birthdays.  <br><br>BEER:  Kirin Ichiban-Shibori or Heineken on draft.",
