"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ViBsU86egYTUC5VqTrzI5g/l.jpg",
"rating":"4.0",
"reviewcomment":"If you are a fan of MUJI like me you have to go here if only for an hour. Meal MUJI is located inside Atelier MUJI and can only be accessed through the main store. Here you can enjoy a simple lunch or have a coffee break from the crowded shopping streets of Ginza. <br><br>If you are coming here I would suggest trying their pastries. They are freshly baked and after buying and trying a few of them I can assure you that they are wonderful! I sadly did not get to try their lunch offers, but looking at the tables next to me it seemed like people were pleased.<br><br>Fun fact: For us who love MUJI&#39;s design going to Meal MUJI is a joy for the eyes. Everything from the furnitures to the plates are all from MUJI&#39;s own store and collection which makes the experience here so much more complete.",
