"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/62nr7xhwOZ8HDEA4HYs-FQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Always busy is this fancy looking Starbucks. Oh no, actually, it&#39;s not just a regular Starbucks, but a fancy schmancy Starbucks that goes by the name, &#34;Inspired by Starbucks&#34;. <br>I don&#39;t really understand the name, it definitely look much better than a regular Starbucks but more like a chilled out and cool cafe so I don&#39;t know how it can be inspired by a big coffee chain but whatever, it&#39;s a nice place to hang out if you like to look good and pretentious.<br>Yes, I may be a bit harsh but it&#39;s only because I don&#39;t think Starbucks makes good coffee, however, this shop is a good concept and so coffee aside, I like how their pastries are made in house and they have lots of interesting events in the shop.<br>On a regular basis, they have coffee seminars, coffee art lessons and it is also used as a venue for small art exhibitions, live bands and even patchwork classes.<br>Now that&#39;s what I like about this place. Very local-oriented indeed.<br>The coffee is a little expensive and not what I would recommend but they do serve alcohol and fresh pastries. There are seating outside too so you can bring your puppy and rest with a book if you manage to find a seat.",
