"rating":"4.0",
"reviewcomment":"J.S. Pancake is always yummy but crowded, however if you are looking for a good pancake afternoon restaurant after a stroll in Jiyugoka, it&#39;s worth a try!<br><br>I heard that sometimes theres no line waiting, but I always take a 10-20 min wait.  For me, this is a perfect restaurant to bring my kids for a meal -- healthy lunch, pancake for snack, and mini cute snack pancake for take-out or a small gift for friends.  I solve all the above problems in one place!  So now you know why I frequent J.S. pancake.<br><br>My kids always order sweet pancake, so I order salty ones,  and we enjoy sharing with each other.  My favorite is cheese fondue pancake which is limited in winter, comes along with a small portion of fresh seasonal salad dip, with spinach sauce.  My kids they love strawberries pancakes with fresh strawberries and whipped cream.  I always see many moms and kids in there too -- moms sipping nice coffee with their big mugs, kids talking happily with each other -- enjoy the relaxing afternoons like us.<br><br>Check out this nice pancake restaurant!",
