"reviewcomment":"Visits: 1st<br>Rating: 3.5*<br>Service: excellent<br>Dishes: Ramen 1A &amp; 6A<br><br>This is a small ramen house tucked away a couple of blocks off the main area of Akihabara. A short line full of locals outside (6 people). Not a long wait at all. They serve extremely fast &amp; the people here gulp down their food. You get your bowl within a couple minutes of placing the order.<br><br>-1A (3*), is the usual pork based broth. You get chunks of brown pork that look like they were braised in soy sauce, along with thin slices of char siu &amp; seaweed. You can get a whole egg for a little extra. They come out medium rare with a slightly runny yoke &amp; white center. A must add for me on every ramen bowl. The broth was good &amp; apparently fatty (true to what ramen broth is known for).<br><br>-6A (4*), is a much thicker version of the pork broth. And I mean thick. Felt my arteries clogging as I sipped. But I couldn&#39;t stop myself. I enjoyed it. The menu warned &#34;Spicy!&#34; But it was a medium for me. The tidbits are the same as 1A.",
