"rating":"3.5",
"reviewcomment":"Pomu no Ki used to be my go to omelette rice restaurant in my early twenties.<br>I just couldn&#39;t get enough of omelette rice. I also love their dorias (the bakes rice with omelette on top.<br>The shop is usually filled with young uni students or couples and sometimes mum&#39;s with young children (although the stairs to the restaurant can be a little annoying).<br><br>I usually come for the omelette rice in cream based sauce; sometimes I&#39;d order the teriyaki chicken with spinach and other times, I&#39;d have the salmon in cream sauce. I would also ask for extra cheese as well.<br>Pomu no Ki has a really friendly system where you get to choose your choice of rice and the choice of the portion size. There are 4 sizes with SS as the smallest and L as the largest portion.<br>With the rice flavours, you can choose from the ketchup, Japenese-stlye, the buttered rice and dry curry rice.<br>I always go for the butter rice. <br>Try it out!",
