"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/MrKIUNjrE3FwbX6NnYVG-g/l.jpg",
"rating":"4.0",
"reviewcomment":"You can smell Bistro Kirakutei from a block away. That curry smell is always so inviting. It&#39;s a local favourite but on weekends, there&#39;s always people coming all the way forming queues outside.<br>Of course, it goes without saying, come here for the curry.<br>Last year when my friends came to visit, every time we walked pass, they would ask me about the restaurant. So much so that I decided to take them there for lunch on their last day. We all tried to order different things so they could try as much as possible.<br>I couldn&#39;t resist to order my favourite hamburger curry, Christine ordered the pork katsu curry and Maggie ordered the beef curry. We were all happy curry kids after the meal. The hamburger and Maggie&#39;s beef curry was tender and juicy while Christine&#39;s pork katsu was crunchy and crispy and just so filling. The thick curry just went so well with the saffron rice. <br>The girls even left with a  curry bread each.<br>I didn&#39;t buy one but we were all left smelling like the shop..... guess something could be done with the ventilation....",
