"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/8M7-rDwo2eCXgXCMDkmN3A/l.jpg",
"rating":"4.5",
"reviewcomment":"Cannot believe myself spent more than 100 minutes for lining up the &#39;And the Friet&#39;!!  But it&#39;s worth a try!  Yummy!!<br><br>&#39;And the Friet&#39; is a small cute Belgium potatoes specialist shop, offering the famous Belgium bintje potatoes in three kinds of cuts and various Japanese potatoes including sweet potatoes and purple potatoes.  The order is complicated, but the waiters explained smartly with a smartly-designed menu.  I was thinking of explaining it but I bet you&#39;ll get it as soon as you are there.  We heard the side dish is seriously yummy too, so we decided to order three big boxes -- especially after a 90-minute wait, we were starving!!  Btw, the boxes are well designed and cute too.<br><br>We order three kinds of potatoes: &#39;bintje&#39; country cut, petite ball Friet, and curly cut Friet since all the other 6 kinds were all sold out and it was only 4pm (you see how popular And the Friet is).  And we chose the handmade tomato sauce and winter limited anchovy sauce which is heavenly yummy and goes perfectly with the crispy fries!!  Of course the tomato sauce is totally different from the supermarket canned ketchup, it&#39;s herb-based, and not too watery.  We also chose bean croquette, popcorn shrimp, and fried chicken, and all goes perfectly with the dip.  I highly recommend their dip and gonna go back to try all of them next time.<br><br>I personally enjoyed the petite ball Friet with the anchovy sauce most.  They really has the best fries and best dip!!  The potatoes are crispy outside and well-cooked inside.  They stayed delicious and crispy even after 3 hours.  If you are a potato fan like me, you cannot miss it!!",
