"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/3iNrWTzCU7K31v6TJLAIHg/l.jpg",
"rating":"5.0",
"reviewcomment":"Switch Coffee is a little hole-in-the-wall about ten minutes on foot from Meguro Station, and its friendly sky-blue storefront opens into an intimate little space housing a counter, an espresso machine, an impressive ek43 grinder, and a pro-bat roaster.<br><br>Switch is first and foremost a roastery/kiosk, so won&#39;t find any tables or chairs, though there is a small counter off to the side if you decide to drink your coffee in-store. The atmosphere is relaxed, and the owners (Masa and Wataru) are more than happy to talk you through the unique characteristics of the current coffee selection, or just shoot the breeze.<br><br>Switch also hold workshops focused on enjoying specialty coffee at home - recently these have covered the finer points of making pour-over and French-press coffee. Workshops are 3000 yen and include 100 grams of beans to use at home. Although these are usually held in Japanese, it&#39;s worth asking Masa more about them if you&#39;re interested - he speaks great English and may be able to work something out for you.<br><br>Masa is a simple guy at heart - he just wants to make and share good coffee for the people of his town. I think this is why I like the place: it&#39;s only a little store, but it has a lot of heart, and they&#39;re dedicated to delivering a quality product.",
