"rating":"3.5",
"reviewcomment":"Sigh....boy, this place just spoils me. <br>On a cold winter&#39;s day, what&#39;s more suitable than being warmed up with a mixed hotpot?<br>Last week was freezing and my friend decided to come here for some warmth.<br>We didn&#39;t really care about the all-you-can-eat course but it was still we ordered the 2hour course so we got everything. The 2 hour courses included a choice of 2 soup bases, all the beef and pork you can eat, all the veggies we can munch on and to finish, all the noodles and dessert. Nom nom.<br>When we were still in university, we&#39;d stuff ourselves like mad at these all-you-can-eat places, but not anymore. Still, knowing that you&#39;re not going to be overcharged and is only paying a certain amount is good to know.<br>We choose the kimchee soup and soy milk soup base; a flavrousome, strong and spicy soup for the beef and a milk and creamy soup for the pork.<br>We had a great night out! Can&#39;t wait to go again before the winter ends.",
