"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/dugOWpnTE_LEAkmHQBEfTw/l.jpg",
"rating":"4.5",
"reviewcomment":"Monday mornings are always tough and it makes me especially hungry by lunch time.<br>I always crave to go here for lunch every Monday after a week of way too much drinking. The girls in my office are never embarrassed to ask for a large portion of pasta here. Lunch here is extremely reasonable with free orange juice, tea or coffee. The lunch set, even after ordering larger portions are all under 1000yen. I&#39;d recommend the soup pasta with crab. The soup has the strong taste of crab and you&#39;ll find yourself drinking the whole bowl of soup when no one&#39;s looking.<br>My ultimately favourite is the chili carbonara. As if carbonara is not good enough, they have made their original style of carbonara with a bit of spice, the usual creamy carbonara is added with a yummy cream tomato. The perfect comfort food after a weekend out.",
