"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/08a2v8WgSz5vUSCZDNKz1w/l.jpg",
"rating":"4.5",
"reviewcomment":"Matador! <br>マタドール @Kita-Senju, Tokyo!<br><br>Bull in bowl included!<br><br>Raise the RED flag, in a good way, this place is OISHII YUM!<br><br>The Americanjin in Japan loves this place!<br>Celebrities love this place! And since I&#39;m a BIG celebrity in &#34;some&#34; parts of Japan I had to make a stop...<br><br>The 贅沢焼牛らぁ麺 (luxurious roast beef ramen) is as yummy as it looks. Enormous slices of tender roast beef, Japanese green onion, premium quality shoyu and mirin. <br>The signature soups are made with actual beef bones. Like many mention in Japanese, the soups might be a tad sweeter for the westerner, but your taste buds will thank me later! TRUST! Hai, this place is NOT for the vegetarian! Carnivores or those willing to have cheat days REJOICE!<br><br>This is my third trip to Tokyo, but my first at マタドール! The hype is SPOT-ON! <br>If you ever get to Japan... A definite Ramen &#34;must try&#34; on any noodle bucket list! <br><br>LOCATION: <br>東京都足立区千住東2-4-17 中村ビル1F<br>Tokyo, Adachi-ku, Senjuazuma 2-4-17<br>Closest train station: Kita-Senju (head east exit and walk about 5-minutes).<br>HOURS:<br>Open 11:30-14:30, 18:00-until sold out!<br>Weekends 11:30-until sold out!<br>Closed on Monday!<br><br>SAYONARA &amp; ALOHA...<br><br>YELP REVIEW #240",
