"rating":"4.5",
"reviewcomment":"i&#39;ve had cuts of beef all over the world, but the beef they serve up here is beyond insane.  matsusaka beef is grade A5, meaning its top of the line...truly the Bentley of beef.  when speaking with the owner of this tiny teppanyaki style steakhouse, he literally scoffed when i asked him how the matsusaka beef compared to Kobe beef...it doesnt compare apparently.<br><br>the meal consisted of just one side salad, a bowl of miso soup, a bowl of rice, and one incredible piece of steak...<br><br>cut thru it like a knife goes thru warm butter...<br><br>melts in your mouth, but doesnt leave an oily sensation...<br><br>sensational piece of steak.<br><br>the cost of the meal is 10000 japanese yen, or rougly a 100 bucks in US dollars...well worth it for all 7 people that we had dinner with there.<br><br>the place doesnt take reservations, and closes early at 830pm...usually they dont take parties more than 4...the entire place only seats 16 so if youre a tourist in town and are staying at a hotel, make sure yoh ask your concierge to call for u and ask them to accommodate your party and they will definitely do so...<br><br>amazing steak!!!",
