"reviewcomment":"For some reason, no business lasts long in the tiny corner shop. It&#39;s strange because it&#39;s just a simple hole-in-a-wall shop and only offers take away yet a lot of businesses before C&#39;est Moi closes down within a year. Unlike the others, C&#39;est Moi is going strong and there&#39;s a reason why.<br>Here, they keep it simple. They only sell frizzas. Or rather pizza frizzas. These are small pizza doughs with mainly savoury fillings (generally pizza toppings).<br>Perfect for a little snack on the way home, I would sometimes drop by to pick up 2 or 3 different types of frizzas. And they&#39;re only around 400yen each!<br>Their most popular flavour and it&#39;s also one of my favourites is the margarita. Other delicious choices are their porcine frizzas and four cheese frizzas. When it&#39;s sizzling hot, the cheese pours out with bits of sliced ham. It&#39;s just mouthwatering.<br>If you interested in something sweet, they also have the rich chocolate and raspberry frizza.",
