"reviewcomment":"Best steamed dumplings in town!  Jin Ding Rou! <br><br>My kids are big fans of steamed dumplings (shoronpo in Japanese), and Jing Ding Rou is the best one we&#39;ve every tried!  Kids never lie!  The peel is thin enough, and the meat inside is juicy and hot, perfect with vinegar dip!  My kids also love watching the chefs making the dumplings through the window wall.  I think the secret to the delicious dumplings is that they don&#39;t stock dumplings; the chef won&#39;t start making your dumplings after you order.<br><br>Of course Jing Ding Rou serve a variety of dishes ranging from the simple dumplings to spicy Mapo tofu.  My personal favorite is their sour spicy soup, wined chicken in shaoxing, tantan noodles, etc.  There are two rooms perfect for family or friends get together.  The only thing is they don&#39;t provide parking service.  Reservation needed because it&#39;s too popular!",
