"rating":"3.5",
"reviewcomment":"Probably the fanciest Royal Host family restaurant in town. You probably wouldn&#39;t come here since it&#39;s Kagurazaka and there are loads of great restaurants around but it&#39;s a great place to chill out among locals. By locals, I mean mainly housewives. The interior is very elegant and calm unlike other Royal Host chains. There&#39;s an old English tea house feel to it. The smoking area is clearly split up in separate section with glasses windows.<br><br>I don&#39;t know if it&#39;s just me, but I think there&#39;s a menu here that is slightly different from the other Royal Hosts. Seems like there&#39;s an extra few dishes that are only offered here. I love there oven-bakes gratins, It&#39;s creamy, flavoursome and just so addictive. I should try their grilled hamburgers too since they seem really popular but I always end up ordering my gratin.<br><br>Although you really can&#39;t miss their sign, it&#39;s never really packed and you&#39;ll always find a seat here. It&#39;s great to come kill some time with a book and raid their drink bar.<br>With a clean, relaxing ambiance, this is Royal Host is also a favourite for quick business meetings.",
